import "./UserDatas.css";
import React, { Fragment } from "react";

const UserDatas = (props) => {
    //   console.log(typeof props.userdata);
    //   console.log(props.userdata[0]);
    //   console.log(Object.values(props.userdata));

    return ( <
        >


        <
        span className = "title" > User Datas < /span>

        <
        table className = "table" >
        <
        tr className = "tr" >
        <
        td className = "td" > Id < /td> <
        td className = "td" > Name < /td> <
        td className = "td" > Email < /td> <
        td className = "td" > Phone < /td> <
        td className = "td" > Address < /td> <
        td className = "td" > Views < /td> <
        /tr>

        {
            props.userdata.map((user, index) => {
                { /* console.log(user.address); */ }
                return ( <
                    Fragment key = { index } >
                    <
                    tr className = "tr" >
                    <
                    td className = "td" > { user.id } < /td> <
                    td className = "td" > { user.name } < /td> <
                    td className = "td" > { user.email } < /td> <
                    td className = "td" > { user.phone } < /td> <
                    td className = "td" > { user.address.street }, { user.address.suite }, { user.address.city }, { user.address.zipcode } <
                    /td> <
                    td className = "td"
                    id = 'view-post' >
                    <
                    span id = { user.id }
                    onClick = { e => fetchUsers(e.target.id) } > Views <
                    li > < link to = '/post' > < /link></li > < /span>     <
                    /td> <
                    /tr> <
                    /Fragment>
                );
            })
        } <
        /table> <
        />
    );
};

export default UserDatas;
